import '../Assets/Styles/Content.css';
import ErrorImg from '../Assets/Images/error.png';

function ErrorMessage() {

    const errorMessage = () => {
        let message;
        if (proxyFetchError) message = 'proxy error message';
        if (cleanTechFetchError) message = 'cleanTech error message';

        if (message == undefined) return;

        return (
            <div className='errorMessage'>
                <div className='errorMessage_container'>
                    <img className='errorMessage_Image' src={ErrorImg} />
                    <div className='errorMessage_Text' >{message}</div>
                </div>
            </div>
        )
    }

    return(errorMessage());
}

export default ErrorMessage;
